import React, { useEffect, useState } from "react";
import ReactImageLightbox from "react-image-lightbox";
import "react-image-lightbox/style.css";
import "./Panel.css";
import "../Terminal/Termianl.css";

const InfoPanel = () => {
  const roles = [
    "Open Source Contributor",
    "MERN Developer",
    "Cybersecurity Enthusiast",
    "Social Worker",
    "Tech Blogger",
    "AI/ML Enthusiast",
  ];


  //contact area
  const [formData, setFormData] = useState({
    email: "",
    message: "",
  });

  const [responseMessage, setResponseMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("http://localhost:5000/contact", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(formData),
      });

      const data = await response.json();
      if (response.ok) {
        setResponseMessage("Message sent successfully!");
        setFormData({ email: "", message: "" });
      } else {
        setResponseMessage(data.error || "Something went wrong. Please try again.");
      }
    } catch (error) {
      setResponseMessage("Failed to send the message. Please check your connection.");
    }
  };

  const [currentRole, setCurrentRole] = useState("");
  const [roleIndex, setRoleIndex] = useState(0);
  const [charIndex, setCharIndex] = useState(0);
  const [isDeleting, setIsDeleting] = useState(false);

  const images = [
    "https://imgs.search.brave.com/bT9XBpvB4E7X2hwgEoBO67lmULlMM6Z4z65MO17Lx7c/rs:fit:860:0:0:0/g:ce/aHR0cHM6Ly9tZWRp/YTEucG9wc3VnYXIt/YXNzZXRzLmNvbS9m/aWxlcy90aHVtYm9y/Lzl3MTdHVzRwR0tr/ajJGZmdjbGVpMEFR/V05EOD0vZml0LWlu/Lzc5Mng1MjgvdG9w/L2ZpbHRlcnM6Zm9y/bWF0X2F1dG8oKTp1/cHNjYWxlKCkvMjAy/MC8wNi8yNS8wMzAv/bi8xOTIyMjgzL2Rj/OTEwZTc2OGUzNmE0/MWVfREFSS18xMDVf/VW5pdF8wMjI4NVIu/anBn",
    "https://imgs.search.brave.com/4fizkDMUrNnJsYCuiW00XZqt1Fi9AhKAVlvYV8Mn8pY/rs:fit:500:0:0:0/g:ce/aHR0cHM6Ly9lMC5w/eGZ1ZWwuY29tL3dh/bGxwYXBlcnMvODkz/LzQ3My9kZXNrdG9w/LXdhbGxwYXBlci1k/YXJrLW1hcnRoYS1u/aWVsc2VuLXRodW1i/bmFpbC5qcGc",
    "https://imgs.search.brave.com/vht5PK-IgpL8ygqQf02LeN1HgP2DTAByzR1O_YnDcZM/rs:fit:500:0:0:0/g:ce/aHR0cHM6Ly9lMS5w/eGZ1ZWwuY29tL2Rl/c2t0b3Atd2FsbHBh/cGVyLzY3NS83MTcv/ZGVza3RvcC13YWxs/cGFwZXItZGFyay10/di1zaG93LWNoYXJh/Y3Rlci1saXN0LWRh/cmstbmV0ZmxpeC10/aHVtYm5haWwuanBn"
    // Add more image URLs as needed
  ];

  const [currentImage, setCurrentImage] = useState(0);
  const [isLightboxOpen, setIsLightboxOpen] = useState(false);

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImage((prevImage) => (prevImage + 1) % images.length);
    }, 3000); // Change every 3 seconds

    return () => clearInterval(interval);
  }, [images.length]);

  useEffect(() => {
    const typingSpeed = isDeleting ? 100 : 150; // Typing and deleting speed
    const pauseTime = 2000; // Pause before switching roles

    const handleTyping = () => {
      const role = roles[roleIndex];

      if (isDeleting) {
        setCurrentRole(role.substring(0, charIndex - 1)); // Delete character
        setCharIndex(charIndex - 1);
      } else {
        setCurrentRole(role.substring(0, charIndex + 1)); // Add character
        setCharIndex(charIndex + 1);
      }

      if (!isDeleting && charIndex === role.length) {
        setTimeout(() => setIsDeleting(true), pauseTime); // Pause before deleting
      } else if (isDeleting && charIndex === 0) {
        setIsDeleting(false);
        setRoleIndex((roleIndex + 1) % roles.length); // Move to the next role
      }
    };

    const typingInterval = setInterval(handleTyping, typingSpeed);

    return () => clearInterval(typingInterval); // Cleanup interval
  }, [charIndex, isDeleting, roles, roleIndex]);

  useEffect(() => {
    const canvas = document.getElementById("matrixCanvas");
    const ctx = canvas.getContext("2d");

    // Set canvas dimensions
    canvas.width = window.innerWidth;
    canvas.height = window.innerHeight;

    const letters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
    const fontSize = 16;
    const columns = canvas.width / fontSize;

    const drops = Array(Math.floor(columns)).fill(1);

    const drawMatrix = () => {
      ctx.fillStyle = "rgba(0, 0, 0, 0.05)";
      ctx.fillRect(0, 0, canvas.width, canvas.height);

      ctx.fillStyle = "#ff0000"; // Red text
      ctx.font = `${fontSize}px monospace`;

      drops.forEach((y, x) => {
        const text = letters[Math.floor(Math.random() * letters.length)];
        ctx.fillText(text, x * fontSize, y * fontSize);

        if (y * fontSize > canvas.height && Math.random() > 0.975) {
          drops[x] = 0;
        }
        drops[x]++;
      });
    };

    const interval = setInterval(drawMatrix, 50);

    return () => clearInterval(interval);
  }, []);

  const openLightbox = () => setIsLightboxOpen(true);
  const closeLightbox = () => setIsLightboxOpen(false);

  return (
    <div className="info-panel">
      <canvas id="matrixCanvas"></canvas>
      <div className="panel-box scrollbar" id="scrollbar1">
        <div className="content">
          <h1>
            Hello There! <span className="wave">👋</span>
          </h1>
          <h2>I'M VAIBHAV PATIL</h2>
          <p>{currentRole}</p>
        </div>
        <div className="gallery-box">
          <h1 className="gallery-title">Auto-Changing Gallery</h1>
          <div className="gallery-image-container" onClick={openLightbox}>
            <img
              src={images[currentImage]}
              alt={`Image ${currentImage + 1}`}
              className="gallery-image"
            />
          </div>
          {isLightboxOpen && (
            <ReactImageLightbox
              mainSrc={images[currentImage]}
              nextSrc={images[(currentImage + 1) % images.length]}
              prevSrc={images[(currentImage - 1 + images.length) % images.length]}
              onCloseRequest={closeLightbox}
              onMovePrevRequest={() =>
                setCurrentImage((currentImage - 1 + images.length) % images.length)
              }
              onMoveNextRequest={() =>
                setCurrentImage((currentImage + 1) % images.length)
              }
            />
          )}
        </div>

        <div className="project-box">
          <h2 className="project-title">My Recent Projects</h2>
          <div className="row project-grid">
            <div className="col-md-6 project-item">Project 1</div>
            <div className="col-md-6 project-item">Project 2</div>
            <div className="col-md-6 project-item">Project 3</div>
            <div className="col-md-6 project-item">Project 4</div>
          </div>
        </div>
        <div className="resume-box">
          <h2>My Resume</h2>
          <br />
          <div>
            <img
              src="./image.png"
              style={{ width: "80%", height: "60%" }}
              alt="Image"
            />
          </div>
        </div>
        <div className="contact-box">
      <h2>Contact</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label htmlFor="message">Message:</label>
          <textarea
            id="message"
            name="message"
            value={formData.message}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit">Send</button>
      </form>
      {responseMessage && <p>{responseMessage}</p>}
    </div>
      </div>
    </div>
  );
};

export default InfoPanel;
